import React, { useState, useEffect } from 'react';
import { useAuth } from '../context/authContext';
import { useNavigate } from 'react-router-dom';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import ExitToAppIcon from '@mui/icons-material/ExitToApp';
import { red } from '@mui/material/colors';
import IconButton from '@mui/material/IconButton';
import AddIcon from '@mui/icons-material/Add';
import Stack from '@mui/material/Stack';
import MainContent from './MainContent';  // Adjust if necessary
import AddClassDialog from '../components/AddClassDialog';  // Adjust path if necessary

export default function PermanentDrawer() {
  const drawerWidth = 240;
  const { currentUser, logout } = useAuth();
  const navigate = useNavigate();
  const [dialogOpen, setDialogOpen] = useState(false);
  const [classes, setClasses] = useState([]);

  const fetchClasses = async () => {
    if (currentUser?.email) {
      try {
        const response = await fetch('/user/getclasses', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json'
          },
          body: JSON.stringify({ email: currentUser.email })
        });
        if (response.ok) {
          const data = await response.json();
          setClasses(data);
        } else {
          throw new Error('Failed to fetch classes');
        }
      } catch (error) {
        console.error("Error fetching classes:", error);
      }
    }
  };

  useEffect(() => {
    fetchClasses();
  }, [currentUser]);

  const addClassOptimistically = (newClass) => {
    const optimisticNewClasses = [...classes, newClass];
    setClasses(optimisticNewClasses);
    // Simulate API call to add the class on the backend
    fetch('/user/addClass', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({ newClass, email: currentUser.email })
    }).then(response => {
      if (!response.ok) {
        // If the backend operation fails, revert the optimistic update
        setClasses(classes);
        alert('Failed to add the class. Please try again.');
      }
    }).catch(error => {
      console.error('Error adding class:', error);
      setClasses(classes);
      alert('Failed to add the class. Please try again.');
    });
  };

  const handleDialogClose = (newClass) => {
    setDialogOpen(false);
    if (newClass) {
      addClassOptimistically(newClass);  // Pass the new class data to be added optimistically
    }
  };

  const handleLogout = async () => {
    try {
      await logout();
      navigate('/');
    } catch (error) {
      console.error("Failed to log out:", error);
    }
  };

  return (
    <Box sx={{ display: 'flex' }}>
      <Drawer
        variant="permanent"
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          [`& .MuiDrawer-paper`]: { width: drawerWidth, boxSizing: 'border-box' },
        }}
      >
        <Box sx={{ overflow: 'auto' }}>
          <Stack direction="row" alignItems="center" justifyContent="space-between" sx={{ p: 2 }}>
            <Typography variant="h6" noWrap component="div">
              Classes
            </Typography>
            <IconButton aria-label="add new class" size="small" onClick={() => setDialogOpen(true)}>
              <AddIcon />
            </IconButton>
          </Stack>
          <Divider />
          <List>
            {classes.map((classInfo, index) => (
              <ListItem key={index} disablePadding>
                <ListItemButton>
                  <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon>
                  <ListItemText primary={classInfo.name} />
                </ListItemButton>
              </ListItem>
            ))}
          </List>
          <Divider />
          <ListItem disablePadding>
            <ListItemButton onClick={handleLogout}>
              <ListItemIcon>
                <ExitToAppIcon sx={{ color: red[500] }} />
              </ListItemIcon>
              <ListItemText primary="Logout" primaryTypographyProps={{ color: red[500] }} />
            </ListItemButton>
          </ListItem>
        </Box>
      </Drawer>
      <MainContent />
      <AddClassDialog open={dialogOpen} handleClose={handleDialogClose} />
    </Box>
  );
}
